import React, { Component } from 'react';
import './Login.css';

class Login extends Component{

  render(){
    return (
      <div className="Login">
      <p style={{textAlign:'center'}}> Login </p>
        <input className="Login-inputBox" type="text" placeholder="username"/>
      <div>
        <input className="Login-inputBox" type="password" placeholder="password"/>
      </div>
      <div>
        <button className="Login-Submit" onClick={() => alert("Hello")}> Login </button>
        </div>
     </div>


    );
  }
}

export default Login;
